"""Running MFA on categorical and numerical variables sepeartely as FAMD (Factor ANlaysis of Mixed Data was prevented due to the way data was encoded)"""

groups = {'categories':['anaemia','diabetes','high_blood_pressure','sex','smoking']}
mfa = MFA(groups = groups, n_components = 5, n_iter = 200, random_state = 101)
mfa.fit(df)
mfa.transform(df)
mfa.plot_row_coordinates(X=df,labels = df.index, color_labels=['Death Event {}'.format(t) for t in df['DEATH_EVENT']])

